	(5, '[이벤트] 바나나우유,아메리카노를 쏩니다.', '이근처 합승 이벤트를 진행합니다.\r\n\r\n1. 선착순 100명에게 스타벅스 아메리카노를 쏩니다.\r\n(2015-02-13~2015-03-31)\r\n\r\n이근처 합승을 설치/가입한 회원들에게 아메리카노를 선착순으로 무조건 쏩니다.\r\n주위에 많이많이 알려서 아메리카노를 받아가세요.\r\n\r\n2. 선착순 300명에게 바나나 우유를 쏩니다.\r\n(위 1번에 해당되지 않을 경우)\r\n(2015-02-09~2015-03-31)\r\n\r\n이근처 합승을 설치/가입한 회원들에게 바나나우유를 무조건 쏩니다. 주위에 마니마니 퍼뜨려서 바나나우유를 받아가세요.\r\n', 'TEXT', NULL, '2015-02-12 15:29:56');
INSERT INTO `notice_list` (`noticeID`, `title`, `content`, `type`, `landingURL`, `createdDate`) VALUES
	(6, '이근처 합승 1.35 업데이트 안내', '사용자 여러분 안녕하세요.\r\n\r\n이근처 합승 1.35 업데이트 안내드립니다.\r\n\r\n이미지 확대 기능 추가\r\n이미지 업로드 시 자르기 기능 추가\r\n이미지 캐싱\r\n디자인 개선\r\n배터리 효율 개선\r\n페이징처리로 인한 데이터 감소\r\n프로필 조회 푸쉬 추가\r\n푸쉬 수신 설정 항목 추가\r\n이 밖에 각종 버그 수정\r\n\r\n안드로이드 마켓에서 최신버전으로 업데이트 가능합니다.\r\n\r\n앞으로도 많은 이용 바랍니다.\r\n\r\n감사합니다.', 'TEXT', NULL, '2015-03-24 22:25:30');
