-- 테이블 nearhere.post 구조 내보내기
CREATE TABLE IF NOT EXISTS `post` (
  `userID` varchar(30) NOT NULL,
  `postID` int(11) NOT NULL AUTO_INCREMENT,
  `type` varchar(10) NOT NULL,
  `message` text,
  `content` text,
  `fromLatitude` varchar(30) NOT NULL COMMENT '출발지',
  `fromLongitude` varchar(30) NOT NULL COMMENT '출발지',
  `fromAddress` varchar(200) DEFAULT NULL,
  `latitude` varchar(30) NOT NULL COMMENT '도착지 혹은 해당 위치',
  `longitude` varchar(30) NOT NULL COMMENT '도착지 혹은 해당 위치',
  `toAddress` varchar(200) DEFAULT NULL,
  `reward` varchar(50) DEFAULT NULL COMMENT '보상(HELP의 경우)',
  `sexInfo` varchar(30) DEFAULT NULL,
  `numOfUsers` varchar(10) DEFAULT NULL,
  `departureDate` varchar(20) DEFAULT NULL,
  `departureTime` varchar(20) DEFAULT NULL,
  `departureDateTime` datetime DEFAULT NULL,
  `status` varchar(20) DEFAULT '진행중',
  `finishedBySystem` varchar(1) DEFAULT NULL,
  `region` varchar(10) DEFAULT NULL,
  `vehicle` varchar(10) DEFAULT '택시',
  `fareOption` varchar(20) DEFAULT '나눠서 분담',
  `repetitiveYN` varchar(1) DEFAULT NULL,
  `createdDate` datetime NOT NULL,
  `updatedDate` datetime DEFAULT NULL,
  `deletedDate` datetime DEFAULT NULL,
  PRIMARY KEY (`postID`),
  KEY `departureDateTime` (`departureDate`),
  KEY `userID` (`userID`),
  KEY `type` (`type`),
  KEY `fromLatitude` (`fromLatitude`),
  KEY `fromLongitude` (`fromLongitude`),
  KEY `deletedDate` (`deletedDate`),
  KEY `latitude` (`latitude`),
  KEY `longitude` (`longitude`),
  KEY `status` (`status`),
  KEY `region` (`region`),
  KEY `createdDate` (`createdDate`)
) ENGINE=InnoDB AUTO_INCREMENT=734 DEFAULT CHARSET=utf8 COMMENT='게시글';

